sidebarCSS:
#root.root {--active-el-bg: transparent;}
#root.root {--toolbar-el-overlay-selected-border: transparent;}
#root.root {--frame-el-overlay-selected-border: transparent;}
#root.root {--general-margin: 3px;}
#root.root {--toolbar-bg: transparent;}
#root.root {--frame-bg: transparent;}
#root.root {--tabs-activated-bg: light-dark(#fff, #ffffff33);}
#root.root {--nav-btn-margin: 8px;}
#root.root {--nav-btn-width: 37px;}
#root.root {--nav-btn-height: 37px;}
#root.root {--nav-btn-len-margin: 3px;}
#root.root {--tabs-audio-btn-width: 22px;}
#root.root {--tabs-margin: 3px;}
#root.root {--tabs-height: 36px;}
#root.root {--tabs-inner-gap: 10px;}
#root.root {--tabs-border-radius: 12px;}
#root.root {--tabs-pinned-width: 48px;}
#root.root {--tabs-pinned-height: 48px;}
#root.root {--general-border-radius: 12px;}
#root.root {--nav-btn-active-shadow: none;}

.Tab {
  margin-top: 3px;
  margin-bottom: 3px;
}

.Tab .audio:hover {
  background: light-dark(#aaa, #666);
  height: 18px;
  width: 18px;
  border-radius: 50px;
  margin-top: 9px;
  margin-left: 3px;
}

.Tab[data-pin="true"] .audio { 
  background: transparent;
  box-shadow: none;
  right: 6px;
  top: 6px;
}

.Tab[data-pin="true"] .audio:hover { 
  background: light-dark(#aaa, #666);
  height: 18px;
  width: 18px;
  border-radius: 50px;
  margin-top: -1px;
  margin-right: -1px;
}

.Tab[data-pin="true"] .body {
	background-color: light-dark(rgba(70, 70, 70, .1), rgba(170, 170, 170, .2));
  box-shadow: none;
  margin: 2px;
  width: 62px;
  height: 45px;
}

.Tab[data-pin="true"][data-active="true"] .body,
.Tab[data-active="true"] .color-layer {
  background-color: light-dark(rgba(255, 255, 255, .9), rgba(170, 170, 170, .5));
}

.Tab[data-pin="false"][data-active="true"] .body {
	box-shadow: 0 1px 2px 0 rgba(0,0,0,0.25);
}

.Tab[data-active="true"] .color-layer {
	box-shadow: inset 0 0 0 2px var(--tab-color);
}

.Tab[data-active="false"] .color-layer,
.Tab[data-pin="false"] .color-layer {
  display: none;
}

.PinnedTabsBar .tab-wrapper {
  flex: 0 1 32%;
}

.top-horizontal-box {
  margin-left: 8px;
  margin-bottom: -2px;
  scale: .8;
  order: 3
}

.top-horizontal-box .icon {
  opacity: .7;
}

.NavigationBar .audio {
  display: none;
}

.NavigationBar .nav-item:not(:first-child) .icon {
  scale: .6;
}

.NavigationBar .nav-item[data-active=true] {
  background: none;
}

.NavigationBar .nav-item[data-active=false] .icon {
  opacity: .35;
}

.ScrollBox .top-shadow {
  left: 0px;
  top: 0px;
  box-shadow: none;
  border-top: .5px solid color-mix(in srgb, var(--frame-fg) 15%, transparent);
}

.ScrollBox .bottom-shadow {
  left: 0px;
  bottom: 0px;
  box-shadow: none;
  border-bottom: .5px solid color-mix(in srgb, var(--frame-fg) 15%, transparent);
}

.TabsPanel .new-tab-btns {
  order: -1;
  padding-top: 2px;
}

.TabsPanel .new-tab-btns:not(:hover) {
  opacity: .7;
}

.TabsPanel .new-tab-btn {
  width: calc(100% - var(--tabs-margin) * 2);
  height: var(--tabs-height);
  justify-content: start;
}

.TabsPanel .new-tab-btn::after {
  content: "New Tab";
  font: var(--tabs-font);
  color: var(--tabs-normal-fg);
}

.TabsPanel .new-tab-btn >svg,
.TabsPanel .new-tab-btn >img {
  scale: 1.22;
  position: static;
  margin: 0 11px 0 12px;
  background-color: light-dark(#525252, #c9c9cb);
  fill: light-dark(#525252, #c9c9cb);
  mask: url("data:image/svg+xml,%3Csvg width='16' height='16' version='1.1' viewBox='0 0 16 16' xmlns='http://www.w3.org/2000/svg'%3E%3Ctitle%3EVetro%3C/title%3E%3Cpath d='M 8.46944,13.848 H 7.7509284 c -0.1983092,0 -0.3592558,-0.187648 -0.3592558,-0.418858 V 2.538857 C 7.3916726,2.3076479 7.5526192,2.12 7.7509284,2.12 H 8.46944 c 0.1983088,0 0.359256,0.1876479 0.359256,0.418857 v 10.890285 c 0,0.23121 -0.1609472,0.418858 -0.359256,0.418858 M 13.968,8.5327903 c 0,0.2093097 -0.190848,0.3791849 -0.426001,0.3791849 H 2.466 C 2.230848,8.9119752 2.04,8.7421 2.04,8.5327903 V 7.7744214 c 0,-0.2093096 0.190848,-0.3791842 0.426,-0.3791842 h 11.075999 c 0.235153,0 0.426001,0.1698746 0.426001,0.3791842 z' fill='context-fill' /%3E%3C/svg%3E%0A");
}

#root.root {
--tabs-indent: 0;
@media (max-width: 67px) {

.fav {
  margin-left: 22px;
  margin-right: 22px;
}

.close {
  width: 16px;
  height: 16px;
  margin-top: 8px;
  margin-right: 38px;
}

.PinnedTabsBar .tab-wrapper:not(:first-child) {
  margin-top: -8px;
}

.Tab[data-pin="true"] .body {
  margin: 0 0 0 3px;
  width: 62px;
  height: 36px;
}

.Tab .audio {
  margin-left: 7px;
  margin-top: -7px;
}

.Tab .audio:hover {
  margin-top: 2px;
  margin-left: 10px;
}

.Tab[data-pin="true"] .audio { 
  right: 6px;
  top: 12px;
}

.Tab[data-pin="true"] .audio:hover { 
  margin-top: -8px;
}

.TabsPanel .new-tab-btn {
  justify-content: center;
}

.TabsPanel .new-tab-btn::after {
  content: "";
}

.PinnedTabsBar {
  margin-left: -3.5px;
  margin-bottom: -6px;
}

.top-horizontal-box {
  margin-bottom: 18px;
}
}

